import React from "react";
import "../Home.css";

export default function Home() {
  return (
    <div>
      <div id="div1">
        <p>All students are assigned</p>
      </div>
      <div id="div2">
        <p>No student assigned to you</p>
      </div>
    </div>
  );
}
